//===========================================================================
// RF Inference Functions
//===========================================================================

#define RF_READ_NODE(idx) ({ \
    rf_node_t _n; \
    memcpy_P(&_n, &RF_NODES[idx], sizeof(rf_node_t)); \
    _n; })

static inline uint8_t rf_predict_tree(uint16_t treeIdx, const float* features) {
    uint32_t nodeIdx = 0;
    memcpy_P(&nodeIdx, &RF_TREE_ROOTS[treeIdx], sizeof(uint32_t));
    rf_node_t node = RF_READ_NODE(nodeIdx);
    
    while (node.featureIndex >= 0) {
        if (features[node.featureIndex] < node.threshold) {
            nodeIdx = (uint32_t)node.leftChild;
        } else {
            nodeIdx = (uint32_t)node.rightChild;
        }
        node = RF_READ_NODE(nodeIdx);
    }
    return node.label;
}

static inline uint8_t rf_predict(const float* features) {
    uint16_t votes[12] = {0};
    for (uint16_t t = 0; t < RF_NUM_TREES; t++) {
        uint8_t pred = rf_predict_tree(t, features);
        if (pred < 12) votes[pred]++;
    }
    uint8_t best = 0;
    uint16_t maxVotes = 0;
    for (uint8_t i = 0; i < 12; i++) {
        if (votes[i] > maxVotes) { maxVotes = votes[i]; best = i; }
    }
    return best;
}

static inline uint8_t rf_predict_with_confidence(const float* features, float* confidence) {
    uint16_t votes[12] = {0};
    for (uint16_t t = 0; t < RF_NUM_TREES; t++) {
        uint8_t pred = rf_predict_tree(t, features);
        if (pred < 12) votes[pred]++;
    }
    uint8_t best = 0;
    uint16_t maxVotes = 0;
    uint16_t secondVotes = 0;
    for (uint8_t i = 0; i < 12; i++) {
        if (votes[i] > maxVotes) {
            secondVotes = maxVotes;
            maxVotes = votes[i];
            best = i;
        } else if (votes[i] > secondVotes) {
            secondVotes = votes[i];
        }
    }

    // Laplace smoothing with vote margin and OOB-based calibration to dampen overconfident outputs
    const float laplaceTop = (float)(maxVotes + 1) / (float)(RF_NUM_TREES + RF_NUM_CLASSES);
    float margin = (float)(maxVotes - secondVotes) / (float)RF_NUM_TREES;
    if (margin < 0.0f) margin = 0.0f;
    const float calibration = 1.0f - RF_OOB_ERROR;

    *confidence = laplaceTop * (0.5f + 0.5f * margin) * calibration;
    return best;
}

static inline const char* rf_get_class_name(uint8_t idx) {
    return (idx < 12) ? RF_CLASS_NAMES[idx] : "unknown";
}

